contracts/Greeter.sol.content:
pragma solidity ^0.4.0;

contract Greeter {
    string private yourName;

    function Greeter() public {
        yourName = "World";
    }

    function set(string name) public {
        yourName = name;
    }

    function hello() constant public returns (string) {
        return yourName;
    }
}

